import Heading from './Heading';
import Para from './Para';
import Greeting from './Greeting';
import './index.css';

function App() {
    return (
        <>
            <Para/>
            <Heading />
            <Para />
            <Greeting/>

            <ol>
                <li>demo1</li>
                <li>demo2</li>
                <li>demo3</li>
            </ol>

        </>
    )
}

export default App;
